The villagers look at each other uncertainly, and Mayor Snookums scratches his head. "Ah, I'm not sure I know what you mean, Miku. Bracken is a nice name, but I'm not aware of any fox with that name in the village."

The fox, Bracken, looks up at you with big, curious eyes, as if to say "Wait, what's going on here?"

##CMD_START## {"action": "summon", "parameters": {"type": "fox", "name": "Bracken"}}

The villagers "awww" in unison, clearly charmed by Bracken's cute expression. Mayor Snookums chuckles and says, "Ah, I think we can all agree that Bracken is a delightful addition to our village. Perhaps we can even find a home for him in the village?"

As you continue to fawn over Bracken, you notice that he seems to be enjoying the attention. He nuzzles your hand, and you can't help but laugh at his antics.

##CMD_START## {"action": "summon", "parameters": {"type": "villager", "profession": "farmer", "name": "Bracken"}}

The villagers nod in agreement, and Mayor Snookums smiles. "Ah, I think that's a wonderful idea, Miku! Bracken would love to live with you in your cozy little cottage. You can keep him company and take care of him, and I'm sure he'll be a big help with your gardening and other village activities."

The villagers all cluck and agree, and soon Bracken is bounding over to you, tail wagging excitedly, as if to say "Yes, let's go live with Miku!"

